import React from 'react'
import '../P57.css'

const P57StairTitle = () => {
    return (
        <div className="box-container">
            <div className="box box-1">층</div>
            <div className="box box-2">시설</div>
            <div className="box box-3">설명</div>
        </div>
    )
}

export default P57StairTitle
